import React from 'react'
import { View, Text, TouchableOpacity, StyleSheet } from "react-native";
import Icon from 'react-native-vector-icons/FontAwesome';

export default function NovoContato({ navigation }) {
    return (
        <>
            <View style={styles.header}>
                <TouchableOpacity onPress={() => navigation.navigate("ListaTell")} style={styles.icon}>
                    <Icon name="plus" size={30} color="#fff" />
                </TouchableOpacity>
                <Text style={styles.title}>Novo Contato</Text>
                <View style={styles.icon} />
            </View>

            <View>
                <Text>NovoContato</Text>
            </View>
        </>
    )
}

const styles = StyleSheet.create({
    header: {
        height: 50,
        backgroundColor: "#1670f7",
        borderBottomColor: "#000000",
        flexDirection: 'row',
        alignItems: "center",
        justifyContent: "center",
    },
    icon: {
        flex: 1,
    },
    title: {
        fontSize: 20,
        fontWeight: "bold",
        color: "#ffff",
        flex: 2,
    }
});
